      /// Get access token with internal (write) scope\n        /// </summary>\n        public static async Task<dynamic> GetInternalAsync()\n        {\n            if (InternalToken == null || InternalToken.ExpiresAt < DateTime.UtcNow)\n            {\n                InternalToken = await Get2LeggedTokenAsync(new Scope[] { Scope.BucketCreate, Scope.BucketRead, Scope.BucketDelete, Scope.DataRead, Scope.DataWrite, Scope.DataCreate, Scope.CodeAll });\n                InternalToken.ExpiresAt = DateTime.UtcNow.AddSeconds(InternalToken.expires_in);\n            }\n            return InternalToken;\n        }\n        /// <summary>\n        /// Get the access token from Autodesk\n        /// </summary>\n        private static async Task<dynamic> Get2LeggedTokenAsync(Scope[] scopes)\n        {\n            TwoLeggedApi oauth = new TwoLeggedApi();\n            string grantType = "client_credentials";\n            dynamic bearer = await oauth.AuthenticateAsync(\n              GetAppSetting("APS_CLIENT_ID"),\n              GetAppSetting("APS_CLIENT_SECRET"),\n              grantType,\n              scopes);\n            return bearer;\n        }\n        /// <summary>\n        /// Reads appsettings from web.config\n        /// </summary>\n        public static string GetAppSetting(string settingKey)\n        {\n            return Environment.GetEnvironmentVariable(settingKey).Trim();\n        }\n    }\n}\n')),(0,a.kt)("p",null,"Projeto pronto! Neste ponto, deve parecer"),(0,a.kt)("img",{src:"data:image/webp;base64,",style:{width:300}}))}D.isMDXComponent=!0;const M={},j="Criar servidor",x={unversionedId:"tutorials/design-automation/create-server",id:"tutorials/design-automation/create-server",title:"Criar servidor",description:"Seu 'Client ID' e 'Secret' devem ser protegidos e mantidos confidenciais, pois todos os seus arquivos estar\xe3o vinculados \xe0 sua conta. Para um aplicativo Web, mantenha-o em seu servidor. Esta se\xe7\xe3o demonstra como preparar a cria\xe7\xe3o de u